package collections;

import java.util.TreeSet;

public class Treeset1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		TreeSet ts=new TreeSet();
		ts.add(10);
		ts.add(38);
		ts.add(34);
		ts.ceiling(23);
		ts.higher(34);
		ts.floor(124);
		ts.lower(434);
		System.out.println(ts);

	}

}
